import{_ as a,o as e,c as t,b as r}from"./chunks/framework.6c3c27db.js";const o="/assets/201904121139516265.b4c0a369.jpg",m=JSON.parse('{"title":"Щепки","description":"Столярный коворкинг","frontmatter":{"title":"Щепки","description":"Столярный коворкинг","date":"2019-10-16","icon":"haLRqcNiguU.png","cover":"FnhZulILLzg.jpg","url":"https://schepki-coworking.by","email":"schepki.coworking@gmail.com","youtube":"https://youtu.be/P7zpZ3gljAU","city":"г. Минск","address":"ул. Минина 1","tel":375293774413,"facebook":"artelschepki","instagram":"artel_schepki","vk":"artelschepki","coord":[53.87683657808898,27.514776466281482],"status":"open"},"headers":[],"relativePath":"workshop/catalog/sshepki/index.md","filePath":"workshop/catalog/sshepki/index.md"}'),i={name:"workshop/catalog/sshepki/index.md"},l=r('<p>«Щепки Коворкинг» – это столярная школа и открытая творческая мастерская под одной крышей. Комфортная, оборудованная всем необходимым инструментом столярная мастерская, расположенная в шаговой доступности от ТЦ OUTLETO.</p><p>Здесь вы можете получить доступ к образовательным курсам, посещать различные тематические лекции и мастер-классы, а также при помощи наших мастеров реализовать свой проект.</p><p>Совершенно неважно, какой у вас уровень знаний и навыков, новичок вы или профессионал, на наших занятиях Вас встретят специалисты, готовые рассказать, научить и показать как воплотить ваш проект в жизнь.</p><p><img src="'+o+'" alt=""></p><h2 id="столярныи-коворкинг-в-центре-минска" tabindex="-1">Столярный коворкинг в центре Минска <a class="header-anchor" href="#столярныи-коворкинг-в-центре-минска" aria-label="Permalink to &quot;Столярный коворкинг в центре Минска&quot;">​</a></h2><p>Реализуйте свой проект, идею, творческую задачу в нашей столярной мастерской. Вам в помощь – опытные мастера, качественный инструмент и материалы.</p><h3 id="столярныи-коворкинг" tabindex="-1">Столярный Коворкинг <a class="header-anchor" href="#столярныи-коворкинг" aria-label="Permalink to &quot;Столярный Коворкинг&quot;">​</a></h3><p>Доступ к ручному и электроинструменту. Доступ к станочному оборудованию осуществляется по присмотром квалифицированного мастера.</p><h3 id="курсы-и-мастер-классы" tabindex="-1">Курсы и мастер классы <a class="header-anchor" href="#курсы-и-мастер-классы" aria-label="Permalink to &quot;Курсы и мастер классы&quot;">​</a></h3><p>Столярная школа. Столярные курсы и мастер-классы для взрослых и детей</p><h4 id="столярные-услуги" tabindex="-1">Столярные услуги <a class="header-anchor" href="#столярные-услуги" aria-label="Permalink to &quot;Столярные услуги&quot;">​</a></h4><p>У нас можно заказать раскрой, фрезеровку, строгание, шлифовку, финишное покрытие Ваших изделий и заготовок. Изготовление изделий из фанеры и массива по Вашим чертежам.</p><h3 id="«щепки-коворкинг»" tabindex="-1">«Щепки Коворкинг» <a class="header-anchor" href="#«щепки-коворкинг»" aria-label="Permalink to &quot;«Щепки Коворкинг»&quot;">​</a></h3><p>Комфортная, оборудованная всем необходимым инструментом столярная мастерская нового типа, расположенная в шаговой доступности от ТЦ OUTLETO. Квалифицированные мастера смогут помочь Вам как в решении сложных задач, так и обучить базовым столярным навыкам. Кроме этого, вы можете самостоятельно поработать над своим проектом, для этого у нас тоже есть все необходимое: 6 рабочих верстаков, современный ручной и электроинструмент, станочное оборудование для выполнения базовых столярных операций, расходные материалы и СИЗы.</p><h2 id="форматы-коворкинга-которые-мы-предлагаем" tabindex="-1">ФОРМАТЫ КОВОРКИНГА КОТОРЫЕ МЫ ПРЕДЛАГАЕМ: <a class="header-anchor" href="#форматы-коворкинга-которые-мы-предлагаем" aria-label="Permalink to &quot;ФОРМАТЫ КОВОРКИНГА КОТОРЫЕ МЫ ПРЕДЛАГАЕМ:&quot;">​</a></h2><h4 id="самостоятельная-работа-в-коворкинге" tabindex="-1">Самостоятельная работа в коворкинге <a class="header-anchor" href="#самостоятельная-работа-в-коворкинге" aria-label="Permalink to &quot;Самостоятельная работа в коворкинге&quot;">​</a></h4><p><strong>Тариф: от 8 рублей в час</strong></p><p><em>Минимальная оплата времени коворкинга составляет 1 час. Последующее время исчисляется временными промежутками равными 1 часу.</em></p><p>Что входит:</p><ul><li>Доступ 1 человека в мастерскую</li><li>Доступ к 1 рабочему месту</li><li>Доступ ко всему ручному и электроинструменту в мастерской СИЗы</li></ul><p>За дополнительную плату Вы можете приобрести пиломатериалы, абразивы, метизы и финишные покрытия для реализации Вашего проекта. Наличие уточняйте у администратора коворкинга.</p><h4 id="работа-с-мастером" tabindex="-1">Работа с мастером <a class="header-anchor" href="#работа-с-мастером" aria-label="Permalink to &quot;Работа с мастером&quot;">​</a></h4><p>Тариф: от 15 рублей в час</p><p>Что входит:</p><ul><li>Доступ 1 человека в мастерскую</li><li>Доступ к 1 рабочему месту</li><li>Доступ ко всему ручному и электроинструменту в мастерской</li><li>Закрепленный за Вами мастер (профессиональные консультации в рамках Вашего проекта, помощь при составлении чертежей, выполнение работ на станочном оборудовании.</li></ul><p>ВНИМАНИЕ, стоимость самих работ по распилу, торцеванию, раскрою, строганию, рейсмусованию, шлифовке, фрезеровке, сверлению, покрытия тонирующими маслами оплачивается дополнительно по прейскуранту).</p><p>За дополнительную плату Вы можете приобрести пиломатериалы, абразивы, метизы и финишные покрытия для реализации Вашего проекта. Наличие уточняйте у администратора коворкинга.</p><p><a href="https://goodstart.by/startups/kovorking" class="external-link" target="_blank" rel="noreferrer">Статья Путеводителя предпринимателя про Щепки</a></p>',28),s=[l];function p(h,n,c,d,u,_){return e(),t("div",null,s)}const b=a(i,[["render",p]]);export{m as __pageData,b as default};
